import React from "react";
import { Card, Row, Col, Carousel, Container } from "react-bootstrap";
import BotaoComp from "../components/BotaoComp";
import ReleImagem from "../assets/reles-industriais.jpg";
import ControladorImagem from "../assets/p300.jpg";
import digital from "../assets/digital.png";
import "./../App.css";

const Home = () => {
  return (
    <Container className="text-center mt-4">
      <Carousel
        interval={3000}
        controls={true}
        pause={false}
        className="mb-5"
        data-bs-theme="dark"
      >
        <Carousel.Item>
          <img
            className="d-block w-100"
            src={ReleImagem}
            alt="Relés de Estado Sólido"
            style={{ height: "300px", objectFit: "contain" }}
          />
        </Carousel.Item>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src={ControladorImagem}
            alt="Controladores Industriais"
            style={{ height: "300px", objectFit: "contain" }}
          />
        </Carousel.Item>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src={digital}
            alt="Temporizadores Digitais"
            style={{ height: "300px", objectFit: "contain" }}
          />
        </Carousel.Item>
      </Carousel>

      <h2 className="mb-4">Confira nossos Produtos</h2>
      <Row className="mb-4">
        <Col md={4}>
          <Card>
            <Card.Img variant="top" src={ReleImagem} />
            <Card.Body>
              <Card.Title>Relés de Estado Sólido</Card.Title>
              <BotaoComp to="/EstadoSolido">Ver Produtos</BotaoComp>
            </Card.Body>
          </Card>
        </Col>
        <Col md={4}>
          <Card>
            <Card.Img variant="top" src={ControladorImagem} />
            <Card.Body>
              <Card.Title>Controladores Analógicos</Card.Title>
              <BotaoComp to="/controladores">Ver Produtos</BotaoComp>
            </Card.Body>
          </Card>
        </Col>
        <Col md={4}>
          <Card>
            <Card.Img variant="top" src={digital} />
            <Card.Body>
              <Card.Title>Temporizadores Digitais</Card.Title>
              <BotaoComp to="/TemporizadorDigital">Ver Produtos</BotaoComp>
            </Card.Body>
          </Card>
        </Col>
      </Row>
    </Container>
  );
};

export default Home;
